import './App.css';
import Footer from './layout/Footer';
import Navbar from './layout/Navbar';
import Home from './pages/Home';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Home/>
      <Footer className="footer" />
    </div>
  );
}

export default App;
